import React from "react";
import "./MainTemp.css";
import axios from "axios";
import { useState } from "react";

export default function MainTemp(props) {
  let [temp, setTemp] = useState("");
  console.log(props);
  function handleResponse(response) {
    setTemp(response.data.main.temp);
  }
  let url = `https://api.openweathermap.org/data/2.5/weather?q=${props.city}&units=metric&appid=2f7f11cce544f115af9a2c80b2a612b4`;
  axios.get(url).then(handleResponse);
  return (
    <div className="Units">
      <span className="MainTemp">{Math.round(temp)}</span>
      <span>
        <a href="/" className="Celsius">
          °C |
        </a>
      </span>
      <span>
        <a href="/" className="Farengeit">
          °F
        </a>
      </span>
    </div>
  );
}
